import "./App.css";
import Home from "./Views/Home/Home";
import Form from "./Views/Form/Form";
import Detail from "./Views/Detail/Detail";
import Landing from "./Views/Landing/Landing";
import { Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Route>
        <Home />
      </Route>
      <Route>
        <Form />
      </Route>
      <Route>
        <Detail />
      </Route>
      <Route>
        <Landing />
      </Route>
    </div>
  );
}

export default App;
